<script>
export default {
  metaInfo: {
    title: "Juho Pekkala, creative developer & designer / nordics",
  },

  mounted() {
    this.createBackgroundGradient();
  },
  methods: {
    createBackgroundGradient() {
      const colors = new Array(
        [23, 63, 95],
        [32, 99, 155],
        [60, 174, 163],
        [246, 213, 92],
        [255, 178, 95],
        [237, 85, 59]
      );

      /*       const colors = new Array(
        [56, 67, 139],
        [148, 75, 148],
        [215, 90, 136],
        [255, 126, 113],
        [255, 178, 95],
        [255, 235, 104]
      ); */

      let step = 0;

      // Color table indices for:
      // - current color left
      // - next color left
      // - current color right
      // - next color right
      const colorIndices = [0, 1, 2, 3];

      // Transition speed
      const gradientSpeed = 0.002;

      function updateGradient() {
        const gradientBackground = document.getElementById(
          "gradient__background"
        );

        if (gradientBackground) {
          let c0_0 = colors[colorIndices[0]];
          let c0_1 = colors[colorIndices[1]];
          let c1_0 = colors[colorIndices[2]];
          let c1_1 = colors[colorIndices[3]];

          let istep = 1 - step;
          /* let opacity = 0.7; */
          let opacity = 0.7;

          let r1 = Math.round(istep * c0_0[0] + step * c0_1[0]);
          let g1 = Math.round(istep * c0_0[1] + step * c0_1[1]);
          let b1 = Math.round(istep * c0_0[2] + step * c0_1[2]);
          let color1 =
            "rgba(" + r1 + ", " + g1 + ", " + b1 + ", " + opacity + ")";

          let r2 = Math.round(istep * c1_0[0] + step * c1_1[0]);
          let g2 = Math.round(istep * c1_0[1] + step * c1_1[1]);
          let b2 = Math.round(istep * c1_0[2] + step * c1_1[2]);
          let color2 =
            "rgba(" + r2 + ", " + g2 + ", " + b2 + ", " + opacity + ")";

          const gradientBackgroundStyle = gradientBackground.style;

          gradientBackgroundStyle.background =
            "-webkit-gradient(linear, left top, right top, from(" +
            color1 +
            "), to(" +
            color2 +
            "))";

          gradientBackgroundStyle.background =
            "-moz-linear-gradient(left, " +
            color1 +
            " 0%, " +
            color2 +
            " 100%)";

          step += gradientSpeed;

          if (step >= 1) {
            step %= 1;
            colorIndices[0] = colorIndices[1];
            colorIndices[2] = colorIndices[3];

            // Pick two new target color indices
            // Don't pick the same as the current one
            colorIndices[1] =
              (colorIndices[1] +
                Math.floor(1 + Math.random() * (colors.length - 1))) %
              colors.length;
            colorIndices[3] =
              (colorIndices[3] +
                Math.floor(1 + Math.random() * (colors.length - 1))) %
              colors.length;
          }
        } else {
          clearInterval(gradientInterval);
        }
      }

      const gradientInterval = setInterval(updateGradient, 10);
    },
  },
};
</script>

